webpackJsonp([0xe4b072cd504c],{966:function(t,e){t.exports={data:{wordpressPost:{title:"Undergraduate bullying,skirt size and tobacco packaging: Most Read Articles in September",content:'<p>This month&#8217;s top ten most accessed articles includes a systematic review by Abu Dabrh <em>et al</em>. on the health assessment of commercial drivers, Marston <em>et al&#8217;s</em>  study on anal sex and young people is still proving to be a popular read,  Timm&#8217;s survey reporting on medical undergraduate students and bullying is a new entry, whilst Lusignan <em>et al</em> discuss patient&#8217;s online access to electronic health records.</p>\n<table border="1" width="483" cellspacing="0" cellpadding="0">\n<tbody>\n<tr>\n<td valign="top" width="50">Rank</td>\n<td valign="top" width="132">Author(s)</td>\n<td valign="top" width="301">Title</td>\n</tr>\n<tr>\n<td width="50">1</td>\n<td width="132">Abu Dabrh <em>et al.</em></td>\n<td valign="top" width="301"><a href="http://bmjopen.bmj.com/content/4/3/e003434.full">Health assessment of commercial drivers: a meta-narrative systematic review</a></td>\n</tr>\n<tr>\n<td width="50">2</td>\n<td width="132">Marston <em>et al.</em></td>\n<td valign="top" width="301"><a href="http://bmjopen.bmj.com/content/4/8/e004996.full">Anal heterosex among young people and implications for health promotion: a qualitative study in the UK</a></td>\n</tr>\n<tr>\n<td width="50">3</td>\n<td width="132">Timm</td>\n<td valign="top" width="301"><a href="http://bmjopen.bmj.com/content/4/7/e005140.full">‘It would not be tolerated in any other profession except medicine’: survey reporting on undergraduates’ exposure to bullying and harassment in their first placement year</a></td>\n</tr>\n<tr>\n<td width="50">4</td>\n<td width="132">Rao <em>et al</em>.</td>\n<td valign="top" width="301"><a href="http://bmjopen.bmj.com/content/3/12/e004277.full">Do healthier foods and diet patterns cost more than less healthy options? A systematic review and meta-analysis</a></td>\n</tr>\n<tr>\n<td width="50">5</td>\n<td width="132">Parand<em> et al.</em></td>\n<td valign="top" width="301"><a href="http://bmjopen.bmj.com/content/4/9/e005055.full">The role of hospital managers in quality and patient safety: a systematic review</a></td>\n</tr>\n<tr>\n<td width="50">6</td>\n<td width="132">Baars <em>et al.</em></td>\n<td valign="top" width="301"><a href="http://bmjopen.bmj.com/content/4/8/e005332.full">A 6-year comparative economic evaluation of healthcare costs and mortality rates of Dutch patients from conventional and CAM GPs</a></td>\n</tr>\n<tr>\n<td width="50">7</td>\n<td width="132">Lusignan <em>et al</em>.</td>\n<td valign="top" width="301"><a href="http://bmjopen.bmj.com/content/4/9/e006021.full">Patients’ online access to their electronic health records and linked online services: a systematic interpretative review</a></td>\n</tr>\n<tr>\n<td width="50">8</td>\n<td width="132">Stranges <em>et al.</em></td>\n<td valign="top" width="301"><a href="http://bmjopen.bmj.com/content/4/9/e005878.full">Major health-related behaviours and mental well-being in the general population: the Health Survey for England</a></td>\n</tr>\n<tr>\n<td width="50">9</td>\n<td width="132">Fourkala <em>et al.</em></td>\n<td valign="top" width="301"><a href="http://bmjopen.bmj.com/content/4/9/e005400.full">Association of skirt size and postmenopausal breast cancer risk in older women: a cohort study within the UK Collaborative Trial of Ovarian Cancer Screening (UKCTOCS)</a></td>\n</tr>\n<tr>\n<td width="50">10</td>\n<td width="132">Scollo<em> et al.</em></td>\n<td valign="top" width="301"><a href="http://bmjopen.bmj.com/content/4/8/e005873.full">Early evidence about the predicted unintended consequences of standardised packaging of tobacco products in Australia: a cross-sectional study of the place of purchase, regular brands and use of illicit tobacco</a></td>\n</tr>\n</tbody>\n</table>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>Most read figures are based on pdf downloads and full text views. Abstract views are excluded.<!--TrendMD v2.4.3--></p>\n'},site:{siteMetadata:{title:"Gatsby for BMJ blog sites"}}},pathContext:{id:"fcbd788a-cdd4-5bd3-b044-656506cf6eb5"}}}});
